import { Table, Tag,Radio, Divider ,Space} from 'antd';
const SongsPage = () =>{
    const columns = [
        {
            title: 'Name',
            dataIndex: 'name',
            key: 'name',
            render: text => <a>{text}</a>,
        },
        {
            title: 'Age',
            dataIndex: 'age',
            key: 'age',
        },
        {
            title: 'Address',
            dataIndex: 'address',
            key: 'address',
        },
        {
            title: 'Tags',
            key: 'tags',
            dataIndex: 'tags',
            render: songs => (
                <>
                    {songs.map(tag => {
                        console.log(tag)

